import React from "react";
import { BrowserRouter as Router, Route, Link } from "react-router-dom";
import "./nav.scss";
import logo from "../../images/logo_umatech.svg";
import ToggleMenu from "../ToggleMenu/ToggleMenu.jsx";

const Nav = ({ list }) => {
  return (
      <nav className='menu'>
          <div className='container'>

              <ul className='menu-ul menu__menu-ul'>
                  {list.map((li, index) => (
                      <li key={index} className='menu-ul__li'>
                          {li}
                      </li>
                  ))}
                  <Link to='blog' className='menu-ul__li'>Статьи</Link>
              </ul>
              <SocButtons />
          </div>
      </nav>
  );
};
export default Nav;
